This is a Bushmaster M4 model XM15-E2S.  The upper reciever has detachable iron sights and picatinny rail.  Modifications include;

-Knights Armament, 4-side rail system with foregrip;
-Aimpoint M-68 reddot reflex sight;
-Surefire CQB flashlight.

I will also include a Birdcage Compensator and AR-15 barrel tool.

Savage Law Enforcement Model 10 FCP-K configured as follows:
Accustock and Accutrigger;
24" fluted, threaded heavy barrel, 1:10 twist with muzzle brake;
Thread protector;
2 magazines, capacity 4 rounds each;
Evolution Gun Works 0MOA rail scope mount;
Cabela's hard plastic single rifle case;
Vortex Viper PST 6-24x50 FFP scope not included; available separately at $925, Nightforce Ultralight titanium allow mounting rings $150.

Less than 100 rounds fired through this rifle.
Sorry, cannot consider trades or low ball offers.
Pictures include Savage 2013 catalog showing this model.
